import ExpenseItem from "./ExpenseItem";
import "./Expenses.css";

for(let i = 0; i<5; i++){
function Expenses(props) {
  return (
    <div className="expenses">
      <ExpenseItem
        title={props.items[i].title}
        amount={props.items[i].amount}
        date={props.items[i].date}
      />
    </div>
  );
}
}

export default Expenses;
